import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p className="text-3xl">
          Welcome to Vandy Box!
        </p>
      </header>
    </div>
  );
}

export default App;
